import './filme.css'
import { useAuth } from '../config/firebase';
import { useEffect } from 'react'

export const Filme = () => {

    useEffect(() => {
    document.title = "Filme"
  }, [])

    const currentUser = useAuth();

  return (
    <div className = "clasa">
    {currentUser?
      <>
      <div className="strange">Doctor Strange in the Multiverse of Madness</div>
      <img className="menu-item-image" src="https://nerdist.com/wp-content/uploads/2021/01/DoctorStrangeInTheMultiverseOfMadness_Teaser2_Printed_1-Sht_v4_lg.jpg" alt="CRISPY"/>
        <h2>Acum sunteti conectat.</h2>
      </>
        :
      <>
        <h2>Pentru a vedea restul paginilor trebuie sa fiti autentificat.</h2>
      </>
      }
      </div>
  );
}
